function twoSum(nums, target)
  n = #nums
  for i = 0, n - 1 do
    for j = (i + 1), n - 1 do
      if ((nums[i + 1] + nums[j + 1]) == target) then
        return {i, j}
      end
    end
  end
  return {(0 - 1), (0 - 1)}
end

